import React,{Component} from 'react';
//style importer
import * as style from './style';
//component importer

//utils importer

type State = typeof initState;
const initState = {
  string: "Hello my friend" as string
}
class Header extends Component<{},State>{

    state = initState

    render(){
        return (
        <style.Container>
            <p className="hkl">abcd</p>
        </style.Container>
        )
    }
}

export default Header;
